import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { Select, MenuItem } from "@material-ui/core";
import MenuIcon from "@mui/icons-material/Menu";
function Nav() {
  const auth = localStorage.getItem("user");
  const navigate = useNavigate();
  const logout = () => {
    localStorage.clear();
    navigate("/login");
  };
  return (
    <div className="nav">
      <ul className="nav-ul" style={{ display: "flex" }}>
        <input type="checkbox" id="check" />
        <div className="nav-heading">
          <h1>CALIKOM</h1>
        </div>
        <div className="flex-nav">
          <li>
            <Link to={"/"}>Home</Link>
          </li>
          <li>
            <Link to={"/add"}>Pricing</Link>
          </li>
          <li>
            <Link to={"/update"}>Services</Link>
          </li>
          <li>
            <Link to={"/myNotes"}>About</Link>
          </li>
          <li>
            <Link to={"/myNotes"}>Contacts</Link>
          </li>
        </div>
        <label
          for="check"
          className="hamBgr"
          style={{
            color: "white",
            float: "right",
            marginLeft: "auto",
            paddingRight: 20,
          }}
        >
          <i>
            <MenuIcon />
          </i>
        </label>
      </ul>
    </div>
  );
}

export default Nav;
